import { Component, Vue } from 'vue-property-decorator';
import { Swiper } from '@/common/vux';

@Component({
    components: {
        Swiper
    }
})
export default class Games extends Vue {
    slides = [
        {
            url: 'javascript:',
            img: 'temp/slide.jpg'
        },
        {
            url: 'javascript:',
            img: 'temp/slide.jpg'
        },
        {
            url: 'javascript:',
            img: 'temp/slide.jpg'
        }                
    ]
}
